--TABLA LOCALIZACIONES
create table Localizaciones(
    id int not null,
    pais varchar2(255) not null,
    ciudad varchar2(255) not null,
    codigo number(5) not null,
    tipo_moneda varchar2(50) not null,
    constraint PK_Localizaciones primary key (id)
);

create sequence Localizaciones_seq start with 1 increment by 1;

--TABLA PERSONAS
create table Personas(
    id int not null,
    nombre varchar2(255) not null,
    apellido varchar2(255) not null,
    url_imagen varchar2(255),
    lenguaje varchar2(255),
    correo_principal varchar2(255) not null,
    correo_secundario varchar2(255),
    numero_celular varchar2(255) not null,
    localizacion_id number not null,
    constraint PK_Personas primary key (id),
    constraint FK_Localizaciones_Personas foreign key (localizacion_id) references Localizaciones(id)
);

create sequence Personas_seq start with 1 increment by 1;

--TABLA CLIENTES
create table Clientes(
    persona_id int not null,
    fecha_registro date not null,
    cualquier_medio_pago char(1) check(cualquier_medio_pago in (1,0)) not null,
    codigo_invitacion varchar2(255) not null,
    constraint PK_Clientes primary key (persona_id),
    constraint FK_Personas_Clientes foreign key (persona_id) references Personas(id)
); 

--TABLA CONDUCTORES
create table Conductores(
    persona_id int not null,
    fecha_registro date not null,
    codigo_invitacion varchar2(255) not null,
    numero_cuenta varchar2(255) not null,
    entidad_bancaria varchar2(255) not null,
    estado char(1) check(estado in (1,0)) not null,
    constraint PK_Conductores primary key (persona_id),
    constraint FK_Personas_Conductores foreign key (persona_id) references Personas(id)
);

--TABLA DE MEDIOS DE PAGO
create table Medios_pago(
    id int not null,
    tipo_medio varchar2(255) not null,
    cliente_id int not null,
    empresarial char(1) check(empresarial in (1,0)) not null,
    estado char(1) check(estado in (1,0)) not null,
    medio_pago_especifico char(1) check(medio_pago_especifico in (1,0)) not null,
    datos_adicionales varchar2(255),
    constraint PK_Medios_pago primary key (id),
    constraint FK_Clientes_medios_pago foreign key (cliente_id) references Clientes(persona_id)
);

create sequence Medios_pago_seq start with 1 increment by 1;

--TABLA CÓDIGOS PROMOCIONALES
create table Codigos_promocionales(
    id int not null,
    codigo_promocion varchar2(255) not null,
    cliente_id int not null,
    cliente_beneficiario_id int not null,
    estado char(1) check(estado in (1,0)) not null,
    constraint PK_Codigos_promocionales primary key (id),
    constraint FK_Clientes_Codigos_promo foreign key (cliente_id) references Clientes(persona_id),
    constraint FK_Cliente_beneficiario foreign key (cliente_id) references Clientes(persona_id)
);

create sequence Codigos_promocionales_seq start with 1 increment by 1;

--TABLA VEHÍCULOS
create table Vehiculos(
    id int not null,
    placa varchar2(255) not null,
    marca varchar2(255) not null,
    referencia varchar2(255) not null,
    modelo number not null,
    fecha_registro date not null,
    estado char(1) check(estado in (1,0)) not null,
    constraint PK_Vehiculos primary key (id)
);

create sequence Vehiculos_seq start with 1 increment by 1;

--TABLA CONDUCTOR VEHÍCULO
create table Conductores_vehiculos(
    id int not null,
    conductor_id int not null,
    vehiculo_id int not null,
    fecha_registro date not null,
    estado char(1) check(estado in (1,0)) not null,
    constraint PK_Conductores_vehiculos primary key (id),
    constraint FK_Conductores foreign key (conductor_id) references Conductores(persona_id),
    constraint FK_Vehiculos foreign key (vehiculo_id) references Vehiculos(id)
);

create sequence Conductores_vehiculos_seq start with 1 increment by 1;

--TABLA SERVICIOS
create table Servicios(
    id int not null,
    conductor_vehiculo_id int not null,
    tipo_servicio varchar2(255) not null,
    localizacion_id int not null,
    direccion_origen varchar2(255) not null,
    direccion_destino varchar2(255) not null,
    fecha_recepcion timestamp not null,
    fecha_hora_inicio timestamp,
    fecha_hora_fin timestamp,
    kilometros int,
    tiempo int,
    estado varchar2(255) not null,
    tarifa_compartida char(1) check(tarifa_compartida in (1,0)),
    constraint PK_Servicios primary key (id),
    constraint FK_Conductores_vehiculos foreign key (conductor_vehiculo_id) references Conductores_vehiculos(id),
    constraint FK_Localizaciones_Servicios foreign key (localizacion_id) references Localizaciones(id)
);

create sequence Servicios_seq start with 1 increment by 1;

--TABLA DETALLE DE SERVICIOS
create table Detalle_servicios(
    id int not null,
    servicio_id int not null,
    tipo_cobro varchar2(255) not null,
    valor_cobro number(10,2) not null,
    constraint PK_Detalle_servicios primary key (id),
    constraint FK_Servicios_Detalle_servicio foreign key (servicio_id) references Servicios(id)
);

create sequence Detalle_servicios_seq start with 1 increment by 1;

--TABLA DETALLE PAGO
create table Detalle_pagos(
    id int not null,
    servicio_id int not null,
    cliente_medio_pago_id int not null,
    valor_pago number(10,2) not null,
    constraint PK_Detalle_pagos primary key (id),
    constraint FK_Servicios_Detalle_pago foreign key (servicio_id) references Servicios(id),
    constraint FK_Cliente_medios_pago_DP foreign key (cliente_medio_pago_id) references Medios_pago(id)
);

create sequence Detalle_pagos_seq start with 1 increment by 1;

--TABLA RECORRIDOS
create table Recorridos(
    id int not null,
    servicio_id int not null,
    latitud varchar2(255) not null,
    longitud varchar2(255) not null,
    fecha_registro date not null,
    constraint PK_Recorridos primary key (id),
    constraint FK_Servicios_Recorridos foreign key (servicio_id) references Servicios(id)
);

create sequence Recorridos_seq start with 1 increment by 1;

--TABLA DE PAGOS A CONDUCTORES
create table Pagos_conductores(
    id int not null,
    conductor_id int not null,
    servicio_id int not null,
    total_pagado number(10,2) not null,
    liquidado char(1) check(liquidado in (1,0)),
    constraint PK_Pagos_conductores primary key (id),
    constraint FK_Conductores_Pagos foreign key (conductor_id) references Conductores(persona_id),
    constraint FK_Servicios_Pagos_conductores foreign key (servicio_id) references Servicios(id)
);

create sequence Pagos_conductores_seq start with 1 increment by 1;

--TABLA DE LIQUIDACIONES
create table Liquidaciones(
    id int not null,
    conductor_id int not null,
    fecha date not null,
    valor_liquidado number(10,2) not null,
    constraint PK_Liquidaciones primary key (id),
    constraint FK_Conductores_Liquidaciones foreign key (conductor_id) references Conductores(persona_id)
);

create sequence Liquidaciones_seq start with 1 increment by 1;









